import React from "react";
import { Link } from "react-router-dom";
// reactstrap components
import {
  Button,
  Collapse,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  UncontrolledDropdown,
  NavbarBrand,
  Navbar,
  NavItem,
  Nav,
  Container,
  UncontrolledTooltip,
} from "reactstrap";

function DropdownScrollNavbar() {
  const [collapseOpen, setCollapseOpen] = React.useState(false);
  const [navbarColor, setNavbarColor] = React.useState(" navbar-transparent");
  const [buyButtonColor, setBuyButtonColor] = React.useState("neutral");
  React.useEffect(() => {
    const updateNavbarColor = () => {
      if (
        document.documentElement.scrollTop > 499 ||
        document.body.scrollTop > 499
      ) {
        setNavbarColor("");
        setBuyButtonColor("info");
      } else if (
        document.documentElement.scrollTop < 500 ||
        document.body.scrollTop < 500
      ) {
        setNavbarColor(" navbar-transparent");
        setBuyButtonColor("neutral");
      }
    };
    window.addEventListener("scroll", updateNavbarColor);
    return function cleanup() {
      window.removeEventListener("scroll", updateNavbarColor);
    };
  });
  return (
    <>
      {collapseOpen ? (
        <div
          id="bodyClick"
          onClick={() => {
            document.documentElement.classList.toggle("nav-open");
            setCollapseOpen(false);
          }}
        />
      ) : null}
      <Navbar className={"fixed-top" + navbarColor} color="white" expand="lg">
        <Container>

          <div className="navbar-translate">
          <NavbarBrand to="/contact-us" tag={Link} id="navbar-brand">

          <img
            alt="..."
            src={require("assets/img/logo1.png")}
          ></img>

          &nbsp;&nbsp; 941-518-1657<br/>
          edmena24@gmail.com
          <br/>


                      </NavbarBrand>
                      <UncontrolledTooltip target="navbar-brand">
                        Contact us today!
                      </UncontrolledTooltip>
                      <button
                        onClick={() => {
                          document.documentElement.classList.toggle("nav-open");
                          setCollapseOpen(!collapseOpen);
                        }}
                        aria-expanded={collapseOpen}
                        className="navbar-toggler"
                      >

                        <span className="navbar-toggler-bar top-bar"></span>
                        <span className="navbar-toggler-bar middle-bar"></span>

                        <span className="navbar-toggler-bar bottom-bar"></span>
                      </button>
                    </div>
                    <Collapse isOpen={collapseOpen} navbar>


                    <Nav className="ml-auto" id="ceva" navbar>

                      <UncontrolledDropdown nav>
                      <a href="/presentation">
                      <i
                        aria-hidden={true}
                        className="now-ui-icons business_bank"
                      ></i>&nbsp;
                      <span></span>
                      <p>Home</p>
                      </a>
                      </UncontrolledDropdown>

        <UncontrolledDropdown nav>
                      <a href="/Testimonials1">
                          <i
                            aria-hidden={true}
                            className="now-ui-icons business_globe"
                          ></i>&nbsp;
                          <span></span>
                          <p>About Us&nbsp;</p>
                      </a>
                      </UncontrolledDropdown>
                      <UncontrolledDropdown nav>
                        <DropdownToggle
                          caret
                          color="default"
                          data-toggle="dropdown"
                          href="#pablo"
                          id="navbarDropdownMenuLink"
                          nav
                          onClick={(e) => e.preventDefault()}
                        >
                          <i
                            aria-hidden={true}
                            className="now-ui-icons loader_gear"
                          ></i>&nbsp;
                          <span></span>

                          <p>Services&nbsp;</p>
                          </DropdownToggle>
                          <DropdownMenu aria-labelledby="navbarDropdownMenuLink" right>
                            <DropdownItem tag={Link} to="/sections">
                              <i className="now-ui-icons ui-2_settings-90"></i>
                              Paving
                            </DropdownItem>
                            <DropdownItem tag={Link} to="/sign-up">
                              <i className="now-ui-icons design-2_ruler-pencil"></i>
              Painting
                            </DropdownItem>

                            <DropdownItem tag={Link} to="/profile-page">
                              <i className="now-ui-icons education_atom"></i>
                              Pressure Washing
                            </DropdownItem>

                          </DropdownMenu>
                        </UncontrolledDropdown>
                        <UncontrolledDropdown nav>
                        <a href="/Testimonials2">
                            <i
                              aria-hidden={true}
                              className="now-ui-icons design_image"
                            ></i>&nbsp;
                            <span></span>
                            <p>Reviews&nbsp;</p>
                        </a>
                        </UncontrolledDropdown>
                        <UncontrolledDropdown nav>
                        <a href="/contact-us">
                            <i
                              aria-hidden={true}
                              className="now-ui-icons files_paper"
                            ></i>&nbsp;
                            <span></span>
                            <p>Contact Us&nbsp;</p>
                        </a>
                        </UncontrolledDropdown>
                      </Nav>
                    </Collapse>
                  </Container>
                </Navbar>
              </>
            );
          }

export default DropdownScrollNavbar;
